style.css:
@-moz-document domain("facetia.ru") {
/* Заменяем цвет фона на черный */
    body {
        background-color: black !important;
        color: white !important; /* Изменяем цвет текста на белый для контраста */
    }

    /* Дополнительные элементы, которые могут иметь фон */
    * {
        background-color: transparent !important; /* Убираем фон у всех элементов */
    }

    /* Изменяем цвет ссылок */
    a {
        color: #1E90FF !important; /* Цвет ссылок */
    }
}
